export function isOk(input) {
  return input.ok;
}
export function createOk(val) {
  var r = {
    ok: true,
    val: val,
    err: undefined
  };
  return r;
}
export function isErr(input) {
  return !input.ok;
}
export function createErr(err) {
  var r = {
    ok: false,
    val: undefined,
    err: err
  };
  return r;
}